function fetchData(){fetch("https://us-east-1.aws.data.mongodb-api.com/app/azoio-evvkb/endpoint/quizzes",{method:"GET",headers:{"Content-Type":"application/json"}}).then((e=>e.json())).then((e=>generateHTML(e))).catch((e=>{console.log("Error:",e)}))}function generateHTML(e){const t=document.getElementById("quizzes");e=[e],console.log(e),e.forEach((e=>{t.innerHTML+='\n        <div class="bg-indigo-100">\n            <div class="mx-auto max-w-7xl px-6 py-24 sm:py-32 lg:flex lg:items-center lg:justify-between lg:px-8">\n            <h2 class="text-3xl font-bold tracking-tight text-gray-900 sm:text-4xl">Engage in a quiz on<br>{{item.title}}</h2>\n            <div class="mt-10 flex items-center gap-x-6 lg:mt-0 lg:flex-shrink-0">\n                <a href="https://quiz.allwomenstalk.com/{{item._id}}" class="rounded-md bg-indigo-600 px-3.5 py-2.5 text-sm font-semibold text-white shadow-sm hover:bg-indigo-500 focus-visible:outline focus-visible:outline-2 focus-visible:outline-offset-2 focus-visible:outline-indigo-600">Start Quiz</a>\n                <a href="https://quiz.allwomenstalk.com/" class="text-sm font-semibold leading-6 text-gray-900">Learn more <span aria-hidden="true">â†’</span></a>\n            </div>\n            </div>\n        </div>      \n        '}))}const observer=new IntersectionObserver(((e,t)=>{e.forEach((e=>{e.isIntersecting&&(console.log("Intersecting"),fetchData(),t.disconnect())}))}),{rootMargin:"0px 0px -10px 0px"});observer.observe(document.getElementById("quizzes"));